import React from 'react';
import { Switch, Route } from 'react-router-dom';
const Main = () => (
  <main>
    <Switch>
        <Route exact path='/' component={Home}/>
        <Route exact path='/ViewType' component={ViewType}/>
        <Route path='/ViewType/ContEditWindow' component={ContEditWindow}/>

    </Switch>
  </main>
)
export default Main
